import Login from '@pages/login';
import Register from '@pages/register';
import Home from '@pages/home';
import Message from '@pages/message';
import UserInfo from '@pages/userInfo';
import Activity from '@pages/activity';
import Pusher from '@pages/pusher';

const routeMap = [
  // 首页
  {
    path: "/",
    name: "home",
    component: Home,
    exact: true,
    auth: false,
  },
  // 登录
  {
    path: "/login",
    name: "login",
    component: Login,
    auth: false,
  },
  // 注册
  {
    path: "/register",
    name: "register",
    component: Register,
    auth: false,
  },
  // 推荐
  {
    path: "/message",
    name: "message",
    component: Message,
    auth: true,
  },

  // 个人中心
  {
    path: "/userInfo",
    name: "userInfo",
    component: UserInfo,
    auth: true,
  },

  // 福利
  {
    path: "/activity",
    name: "activity",
    component: Activity,
    auth: false,
  },
  // 推送
  {
    path: "/pusher",
    name: "pusher",
    component: Pusher,
    auth: true,
  }
]
export default routeMap
